import logo from './logo.svg';
import './App.css';
import {Button} from '@material-ui/core';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import About from './components/About';
import Work from './components/Work';

function App() {
  return (
    <Router>


        <Switch>
          <Route path="/work">
            <Work />
          </Route>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/">
          <div className="App">
            <header className="App-header">
              <p>
                Lucas Vandermaarel
              </p>
                <Link to="/work"><Button class="gradient-border">View Work</Button></Link>
                <Link to="/about"><Button class="gradient-border">About Me</Button></Link>

            </header>
            </div>
          </Route>
        </Switch>
    </Router>

  );
}

export default App;
